Match tickets for Premier League games at Old Trafford are sold exclusively to Official Members. If you are a Member already, you can check availability and purchase tickets by [clicking here](https://www.eticketing.co.uk/muticketsandmembership/default.aspx?_ga=2.192934825.2016009893.1513605656-1219262988.1513254084). If tickets for the game you are hoping to attend are not available, you can [register your interest](https://display.engagesciences.com/display/container/d/dee13dc4-e7f5-4d1b-a821-43dce7d2ee47/details) so that we can notify you if further tickets do become available for sale.&nbsp;

For games against Arsenal, Chelsea, Liverpool and Manchester City, Official Members need to make a ballot application for the chance to be successful in obtaining tickets. Visit [Tickets &amp; Hospitality](https://www.manutd.com/en/Tickets-And-Hospitality)&nbsp;for more information.

If you are not a Member, you can click on the tab below to know more about an Official Membership.

